export function renderedDive(nodes) {
  if (isEmptyValue(nodes)) {
    return true;
  }

  return [].concat(nodes).every((n) => {
    if (n) {
      const { rendered } = n;
      return isEmptyValue(rendered) || renderedDive(rendered);
